#SOLUTION 1
def longestCommonPrefix(strs):
    # if only 1 string is in strs
    if (len(strs) == 1):
        return strs[0]

    sub_str = strs[0][:]
    rem_strs = strs[1:]
    while (len(sub_str) > 0):
        i=0
        for str1 in rem_strs:
            i+=1
            if (str1.find(sub_str) != 0):
                sub_str = sub_str[:(len(sub_str)-1)]
                break
            elif (i==len(strs)-1):
                print("HERE")
                return sub_str
    return sub_str

#SOLUTION 2
def longestCommonPrefix(strs):
    sub_str=strs[0]
    if(sub_str == ""):
        return sub_str
    for str1 in strs[1:]:
        while(str1.find(sub_str)!=0):
            sub_str = sub_str[:-1]
            if (sub_str == ""):
                return sub_str
    return sub_str

